import React from 'react';
import sdata from './sdata';
import Card from './Card';


const Netflix = () =>{

    return (
        <Card 
          key    = {sdata[0].id}
          imgsrc = {sdata[0].imgsrc}
          title  = {sdata[0].title}
          stitle = {sdata[0].stitle}
          link   = {sdata[0].link}
        />
        );
}


export default Netflix;
